import React from 'react';
import { Button } from './Button';
import { Link } from 'react-router-dom';
import './HeroContent.css';

function HeroContent({
    h1_headline, h2_text
}) { 
    return (
        <>
        <div className="herocontent container">
            <h1>{h1_headline}</h1>
            <h2>{h2_text}</h2>
        </div>
        </>
    );
}

export default HeroContent;
